import { USER_LOGIN_REQUEST } from './userAction'
import produce from 'immer'


const initialState = {
    username: '1'
}

export default (state = initialState, action) => {
    return produce(state, draft => {
        switch (action.data) {
            case USER_LOGIN_REQUEST: {
                break;
            }
        }
    })
}
